import React, { Component, Fragment, useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import "./styles.scss";
import { acGetUsersRequest } from "./../../../../Actions";
import { Avatar } from "@material-ui/core";

export default function HeaderRight(props) {
  const users = useSelector((state) => state.users);
  const dispatch = useDispatch();
  const [username, setUsername] = useState(null);

  useEffect(() => {
    dispatch(acGetUsersRequest());
  }, []);

  useEffect(() => {
    var uid = localStorage.getItem("username");
    var index = users.findIndex((user) => user.id === Number(uid));
    if (index !== -1) {
      setUsername(users[index].username);
    }
  }, [users]);

  const onLogOut = () => {
    localStorage.removeItem("username");
    props.history.push("/global/login");
  };
  return (
    <Fragment>
      <ul className="nav justify-content-end">
        <li className="nav-item">
          <Link to="/" className=" d-none d-xl-inline-block">
            <img
              src="data:image/png;base64,"
              alt=""
            />
          </Link>
        </li>
        <li className="nav-item user">
          <Link to="/global/login" className="login ms-4">
            {/* <i className="fas fa-user"></i> */}
            <Avatar />
          </Link>
          {username ? (
            <ul
              className="nav sub rounded"
              style={{ width: "300%", justifyContent: "center" }}
            >
              <li className="nav-item">
                <Link className="" to="/membership/accountinfo">
                  {username}
                </Link>
              </li>
              <li className="nav-item">
                <button className="btn shadow-none" onClick={onLogOut}>
                  LOG OUT
                </button>
              </li>
            </ul>
          ) : (
            ""
          )}
        </li>
      </ul>
    </Fragment>
  );
}
